import "../styles/home.css"


function HomeContent() {
    return (
        <div>
            <ul>
                <li><a href="/">Cpp style guide</a></li>
                <li><a href="/">Python style guide</a></li>
                <li><a href="/">JavaScript style guide</a></li>
                <li><a href="/">TypeScript style guide</a></li>
                <li><a href="/">Java style guide</a></li>
                <li><a href="/">HTML/Css style guide</a></li>
            </ul>
        </div>
  );
}

export default HomeContent;
